    "2016-10-18T18:01:01.005296",nt"name": "hawaiian-and-pacific-islands-national-wildlife-refuge-complex-narrative-report-1983-1984-c",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Hawaiian
    and Pacific Islands National Wildlife Refuge Complex (including Baker, Hanalei,
    Hawaiian Islands, Howland, Huleia, James Campbell, Jarvis, Johnston Atoll, Kakahaia,
    Kilauea Point, Pearl Harbor, and Rose Atoll NWRs) outlines Refuge accomplishments
    during the 1983 and 1984 calendar years. The report begins with a summary of the
    year's highlights and weather conditions. Land acquisition is covered. The report
    includes a planning section which discusses the master plan, the management plan,
    compliance with environmental and cultural resource mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, funding, safety,
    and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, forests, croplands, grazing, pest control, water rights, and wilderness
    areas. The wildlife section of the report discusses endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, raptors, marine mammals, fisheries
    resources, scientific collections, marking and banding, and disease control. The
    public uses of the Refuge described in this report include outdoor classrooms, interpretive
    programs, fishing, wildlife observation, and outdoor recreation. The equipment and
    facilities section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment replacement, communication systems, and energy conservation.
    Items of interest are provided at the end.",nt"license_title": "License Not
